type lexStackItem struct {
	buf    []byte
	peek   byte
	line   int
	column int
	name   string
	src    *strings.Reader
	prev   *lexStackItem
}

type lex struct {
	lexStackItem
	conf       *Conf
	sawOptions bool
}

func (l *lex) include(name string, source *strings.Reader) {
	push := &lexStackItem{}
	*push = l.lexStackItem
	l.buf = nil
	l.line = 1
	l.column = 0
	l.name = name
	l.src = source
	l.prev = push
	l.getc(0)
}

func (l *lex) getc(c byte) byte {
	if c != 0 {
		l.buf = append(l.buf, c)
	}
	if b, err := l.src.ReadByte(); err == nil {
		l.peek = b
		if b == '\n' {
			l.line++
			l.column = 0
		} else {
			l.column++
		}
		return b
	} else {
		if err == io.EOF {
			l.peek = 0
			return 0
		}
		panic(err)
	}

	panic("unreachable")
}

func (c *Conf) newLex(name string, source *strings.Reader) (l *lex) {
	l = &lex{}
	l.conf = c
	l.line = 1
	l.name = name
	l.src = source
	l.getc(0)
	return
}

func (l *lex) Error(e string) {
	panic(errors.New(e))
}

